"   <div id=\"basicsTopicLeft\">",
"    <div id=\"topicTitle\">",
"     Patient information: Soft tissue sarcoma (The Basics)",
"    </div>",
"    <span class=\"view\">",
"     View in",
"     <a class=\"lang\" href=\"./es-419/soft-tissue-sarcoma-the-basics?source=topic_page\">",
"      Spanish",
"     </a>",
"    </span>",
"    <a class=\"contributor contributor_credentials\" href=\"./authors-and-editors/patient-information\">",
"     Written by the doctors and editors at UpToDate",
"    </a>",
"    <div id=\"topicText\">",
"     <p class=\"headingAnchor\" id=\"H205488105\">",
"      <span class=\"h1\">",
"       What is a soft tissue sarcoma?",
"      </span>",
"      &nbsp;&mdash;&nbsp;A soft tissue sarcoma is a cancer that grows from one of the &ldquo;soft tissues&rdquo; in the body. The soft tissues in the body include the muscles, nerves, blood vessels, and fat.",
"     </p>",
"     <p>",
"      A soft tissue sarcoma happens when normal cells in a soft tissue change into abnormal cells and grow out of control. There are many types of soft tissue sarcomas. The type depends on the kind of soft tissue the cancer grows from.",
"     </p>",
"     <p>",
"      Soft tissue sarcomas are more common in adults than in children. They can grow anywhere in the body, but they happen most often in the arms or legs. They can also grow in the belly, or on the belly or chest wall.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H205488114\">",
"      <span class=\"h1\">",
"       What are the symptoms of a soft tissue sarcoma?",
"      </span>",
"      &nbsp;&mdash;&nbsp;The most common symptom is a lump that grows slowly over weeks to months. The lump doesn&rsquo;t usually cause pain.",
"     </p>",
"     <p>",
"      Having a lump doesn&rsquo;t always mean you have a soft tissue sarcoma. But if you have a lump that doesn&rsquo;t go away, tell your doctor or nurse.",
"     </p>",
"     <p>",
"      Other symptoms of a soft tissue sarcoma depend on where the cancer is in your body. For example, a soft tissue sarcoma in the belly can cause belly pain, bloody bowel movements, or make you feel full after eating only a small amount of food.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H205488121\">",
"      <span class=\"h1\">",
"       Is there a test for a soft tissue sarcoma?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Yes. To check if a lump is a soft tissue sarcoma, doctors usually do:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        An imaging test &ndash; Imaging tests create pictures of the inside of the body. Doctors can do different imaging tests, including an X-ray, MRI scan, or CT scan.",
"       </li>",
"       <li>",
"        A biopsy &ndash; During a biopsy, your doctor will take a small sample of tissue from the lump. Then another doctor will look at the sample under a microscope to see if it has cancer.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H205488128\">",
"      <span class=\"h1\">",
"       What is soft tissue sarcoma staging?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Cancer staging is a way in which doctors find out whether a cancer has spread past the layer of tissue where it began and, if so, how far.",
"     </p>",
"     <p>",
"      The right treatment will depend a lot on the type and stage of your soft tissue sarcoma, and where it is in your body.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H205488135\">",
"      <span class=\"h1\">",
"       How is a soft tissue sarcoma treated?",
"      </span>",
"      &nbsp;&mdash;&nbsp;Most people with a soft tissue sarcoma have 1 or more of the following treatments:",
"     </p>",
"     <p>",
"      <ul class=\"bullet-block\">",
"       <li>",
"        Surgery &ndash; Doctors can sometimes do surgery to remove the soft tissue sarcoma.",
"       </li>",
"       <li>",
"        Radiation therapy &ndash; Radiation kills cancer cells.",
"       </li>",
"       <li>",
"        Chemotherapy &ndash; Chemotherapy is the term doctors use to describe a group of medicines that kill cancer cells.",
"       </li>",
"       <li>",
"        Other medicines &ndash; These include medicines called &ldquo;targeted therapies&rdquo; that work only for cancers that have certain characteristics. Your doctor might do tests to see if your soft tissue sarcoma might respond to these types of medicines.",
"       </li>",
"      </ul>",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H205488142\">",
"      <span class=\"h1\">",
"       What happens after treatment?",
"      </span>",
"      &nbsp;&mdash;&nbsp;After treatment, you will be checked every so often to see if the soft tissue sarcoma comes back. Follow up tests usually include exams and imaging tests. You should also watch for new lumps, because a new lump could mean the soft tissue sarcoma has come back.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H205488149\">",
"      <span class=\"h1\">",
"       What happens if the soft tissue sarcoma comes back?",
"      </span>",
"      &nbsp;&mdash;&nbsp;If the soft tissue sarcoma comes back, your doctor might treat it with surgery, radiation, or chemotherapy.",
"     </p>",
"     <p class=\"headingAnchor\" id=\"H205488156\">",
"      <span class=\"h1\">",
"       What else should I do?",
"      </span>",
"      &nbsp;&mdash;&nbsp;It is important to follow all your doctor&rsquo;s instructions about visits and tests. It&rsquo;s also important to talk to your doctor about any side effects or problems you have during treatment.",
"     </p>",
"     <p>",
"      Getting treated for a soft tissue sarcoma can involve making many choices, such as what treatment to have.",
"     </p>",
"     <p>",
"      Always let your doctors and nurses know how you feel about a treatment. Any time you are offered a treatment, ask:",
"     </p>",
"     <p>",
"      <ul class=\"bulletCompact-block\">",
"       <li>",
"        What are the benefits of this treatment? Is it likely to help me live longer? Will it reduce or prevent symptoms?",
"       </li>",
"       <li>",
"        What are the downsides to this treatment?",
"       </li>",
"       <li>",
"        Are there other options besides this treatment?",
"       </li>",
"       <li>",
"        What happens if I do not have this treatment?",
"       </li>",
"      </ul>",
"     </p>",
