" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Classification of autoimmune hemolytic anemia",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Primary*",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Warm-reactive",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Paroxysmal cold hemoglobinuria",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Cold agglutinin disease",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Secondary",
"        <sup>",
"         &bull;",
"        </sup>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Generalized autoimmune disease (eg, systemic lupus erythematosus)",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Immune deficiency",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Malignancy",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Medication exposure",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        Infections",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * Primary autoimmune hemolytic anemia (AIHA) refers to disorders with only immune-mediated hemolytic anemia and no evidence of an underlying systemic disorder.",
"     <br>",
"      <span class=\"bullet\">",
"       &bull;",
"      </span>",
"      Secondary AIHA refers to disorders with immune-mediated hemolytic anemia in the presence of another condition.",
"     </br>",
"    </div>",
"    <div class=\"reference\">",
"     Courtesy of Russell E Ware, MD, PhD.",
"    </div>",
"   </div>",
"  </div>",
" </div>",
