var title_f16_26_16813="Emergent management of anaphylaxis in adults";
var content_f16_26_16813=[" <div id=\"graphicsToolbar\">",
"  <div id=\"graphicsCopy\">",
"   &copy;2013 UpToDate",
"   <sup>",
"    &reg;",
"   </sup>",
"  </div>",
"  <div id=\"graphicsLinks\">",
"   <a href=\"?imageKey=EM%2F58346&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\">",
"    <img alt=\"Print this page\" src=\"./../images/icn_print.myextg\" title=\"Print this page\"/>",
"   </a>",
"   <a class=\"icontxt textLink\" href=\"?imageKey=EM%2F58346&amp;source=image_view&amp;view=print&amp;elapsedTimeMs=1\" onclick=\"\" title=\"Print this page\">",
"    Print",
"   </a>",
"   <a class=\"etacLink\" href=\"#\">",
"    <img alt=\"Email graphic(s)\" src=\"./../images/icn_email.myextg\" title=\"Email graphic(s)\"/>",
"   </a>",
"   <a class=\"icontxt textLink etacLink\" href=\"#\" title=\"Email graphic(s)\">",
"    Email",
"   </a>",
"  </div>",
" </div>",
" <div class=\"graphic\">",
"  <div class=\"figure\">",
"   <div class=\"ttl\">",
"    Rapid overview: Emergent management of anaphylaxis in adults",
"   </div>",
"   <div class=\"cntnt\">",
"    <table cellspacing=\"0\">",
"     <tbody>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Diagnosis is made clinically:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The most common signs and symptoms are cutaneous (eg, sudden onset of generalized urticaria, angioedema, flushing, pruritus). However, 10 to 20 percent of patients have no skin findings.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         <span style=\"color: #ff0000;\">",
"          Danger signs: Rapid progression of symptoms, respiratory distress (eg, stridor, wheezing, dyspnea, increased work of breathing, persistent cough, cyanosis), hypotension, dysrhythmia, chest pain, collapse.",
"         </span>",
"        </strong>",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Acute management:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        The first and most important therapy in anaphylaxis is epinephrine. There are",
"        <strong>",
"         NO absolute contraindications",
"        </strong>",
"        to epinephrine in the setting of anaphylaxis.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Airway:",
"        </strong>",
"        Immediate intubation if evidence of impending airway obstruction from angioedema; delay may lead to complete obstruction; intubation can be difficult and should be performed by the most experienced clinician available; cricothyrotomy may be necessary.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Promptly and simultaneously, give:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <strong>",
"         IM Epinephrine (1 mg/mL preparation):",
"        </strong>",
"        Give epinephrine 0.3 to 0.5 mg intramuscularly, preferably in the mid-anterolateral thigh; can repeat every 5 to 15 minutes as needed. If symptoms are not responding to epinephrine injections, prepare IV epinephrine for infusion (see below).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <strong>",
"         Place patient in recumbent position",
"        </strong>",
"        , if tolerated, and elevate lower extremities.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <strong>",
"         Oxygen:",
"        </strong>",
"        Give 6 to 8 liters per minute via face mask, or up to 100 percent oxygen as needed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <strong>",
"         Normal saline rapid bolus:",
"        </strong>",
"        Treat hypotension with rapid infusion of 1 to 2 liters IV; repeat as needed; massive fluid shifts with severe loss of intravascular volume can occur.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle2_left\">",
"        Also consider administration of:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <strong>",
"         Albuterol:",
"        </strong>",
"        For bronchospasm resistant to IM epinephrine, give 2.5 to 5 mg in 3 mL saline via nebulizer; repeat as needed.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <strong>",
"         H1 antihistamine:",
"        </strong>",
"        Consider giving diphenhydramine 25 to 50 mg IV (for relief of urticaria and itching only).",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <strong>",
"         H2 antihistamine:",
"        </strong>",
"        Consider giving ranitidine 50 mg IV.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"indent1\">",
"        <strong>",
"         Glucocorticoid:",
"        </strong>",
"        Consider giving methylprednisolone 125 mg IV.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Monitoring:",
"        </strong>",
"        Continuous noninvasive hemodynamic monitoring and pulse oximetry monitoring should be performed; urine output should be monitored in patients receiving IV fluid resuscitation for severe hypotension or shock.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td class=\"subtitle1_single\">",
"        Treatment of refractory symptoms:",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Epinephrine infusion",
"        </strong>",
"        *",
"        <strong>",
"         :",
"        </strong>",
"        For patients with inadequate response to IM epinephrine and IV saline, give epinephrine continuous infusion, 2 to 10 micrograms per minute by infusion pump. Titrate the dose continuously according to blood pressure, cardiac rate and function, and oxygenation.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Vasopressors",
"        </strong>",
"        *",
"        <strong>",
"         :",
"        </strong>",
"        Some patients may require a second vasopressor (in addition to epinephrine). All vasopressors should be given by infusion pump, with the doses titrated continuously according to blood pressure, cardiac rate and function, and oxygenation.",
"       </td>",
"      </tr>",
"      <tr>",
"       <td>",
"        <strong>",
"         Glucagon:",
"        </strong>",
"        Patients on beta-blockers may not respond to epinephrine and can be given glucagon 1 to 5 mg IV over&nbsp;five minutes, followed by infusion of 5 to 15 micrograms per minute.",
"       </td>",
"      </tr>",
"     </tbody>",
"    </table>",
"   </div>",
"   <div class=\"lgnd\">",
"    <div class=\"footnotes\">",
"     * All patients receiving an infusion of epinephrine and/or another vasopressor require continuous noninvasive monitoring of blood pressure, heart rate and function, and oxygen saturation.",
"    </div>",
"    <div class=\"reference\">",
"    </div>",
"   </div>",
"  </div>",
" </div>",
"</div>"].join("\n");
